        "description": "Shot 100% on GoPro. Drop-in on some of the most immersive perspectives from legendary GoPro athlete Travis Rice and fellow rider Elias Elhardt in their latest snowboard film, ‚ÄòDark Matter.‚Äô\n\nIn the film ‚ÄòDark Matter‚Äô, Travis and Elias team up with director Curt Morgan for a celebration of space and time during incredibly unique conditions at the Tordrillo Mountain Lodge in the remote Alaskan backcountry.\n\nDark Matter is available to rent or buy on Amazon Prime:\nhttps://www.amazon.com/Dark-Matter-Travis-Rice/dp/B082Z7X4ZT\n\nRead up on Travis' journey on The Inside Line:\nhttps://gopro.com/en/us/news/travis-rice-dark-matter-gopro-footage\n\nShot 100% on GoPro: https://bit.ly/3ck1YF3\nGet stoked and subscribe: http://goo.gl/HgVXpQ\n\nMusic\nEastern Odyssey - \"Setting Sail\"\nKoven - \"Your Pain\"\nWaterstrider - \"Weaker One\"\nEdamame - \"Sable (ft. Tor)\"\nBadrapper - \"Find You (ft. Konoba)\"\n\nFor more from GoPro, follow us:\nFacebook: https://www.facebook.com/gopro\nTwitter: https://twitter.com/gopro\nInstagram: https://instagram.com/gopro\nTumblr: http://gopro.tumblr.com/\nPinterest: http://www.pinterest.com/gopro   \nInside Line: https://gopro.com/news\nGoPro: https://gopro.com/channel/\n#GoPro",
